import React, { useEffect, useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

const EmployeeList = () => {
  const [employees, setEmployees] = useState([]);
  const [search, setSearch] = useState({ department: "", position: "" });
  const [error, setError] = useState("");
  const navigate = useNavigate();

  // Fetch employees
  const fetchEmployees = async () => {
    try {
      const response = await axios.get("/employee");
      setEmployees(response.data);
    } catch (err) {
      setError("Error fetching employee data");
    }
  };

  // Search employees
  const handleSearch = async () => {
    try {
      const response = await axios.get("/employee/search", { params: search });
      setEmployees(response.data);
    } catch (err) {
      setError("Error fetching search results");
    }
  };

  // Handle View employee details
  const handleView = (id) => {
    navigate(`/employee/${id}`);
  };

  // Handle Edit employee details
  const handleEdit = (id) => {
    navigate(`/employee/edit/${id}`);
  };

  // Handle Delete employee
  const handleDelete = async (id) => {
    try {
      await axios.delete(`/employee/${id}`);
      fetchEmployees(); // Refresh employee list after deletion
    } catch (err) {
      setError("Error deleting employee");
    }
  };

  useEffect(() => {
    fetchEmployees();
  }, []);

  return (
    <div className="container mt-5">
      <h2>Employees</h2>
      <div className="mb-3">
        <input
          type="text"
          placeholder="Department"
          value={search.department}
          onChange={(e) => setSearch({ ...search, department: e.target.value })}
          className="form-control"
        />
        <input
          type="text"
          placeholder="Position"
          value={search.position}
          onChange={(e) => setSearch({ ...search, position: e.target.value })}
          className="form-control mt-2"
        />
        <button onClick={handleSearch} className="btn btn-primary mt-2">
          Search
        </button>
      </div>

      {error && <div className="alert alert-danger">{error}</div>}

      <table className="table">
        <thead>
          <tr>
            <th>Name</th>
            <th>Email</th>
            <th>Position</th>
            <th>Department</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
            <p>http://localhost:3001/</p>
          {employees.length > 0 ? (
            employees.map((emp) => (
              <tr key={emp._id}>
                <td>{`${emp.first_name} ${emp.last_name}`}</td>
                <td>{emp.email}</td>
                <td>{emp.position}</td>
                <td>{emp.department}</td>
                <td>
                  <button
                    onClick={() => handleView(emp._id)}
                    className="btn btn-info btn-sm me-2"
                  >
                    View
                  </button>
                  <button
                    onClick={() => handleEdit(emp._id)}
                    className="btn btn-warning btn-sm me-2"
                  >
                    Edit
                  </button>
                  <button
                    onClick={() => handleDelete(emp._id)}
                    className="btn btn-danger btn-sm"
                  >
                    Delete
                  </button>
                </td>
              </tr>
            ))
          ) : (
            <tr>
              <td colSpan="5" className="text-center">
                No employees found.
              </td>
            </tr>
          )}
        </tbody>
      </table>
    </div>
  );
};

export default EmployeeList;
